import React from 'react';

function App() {
    return (
        <div>
            <input type="checkbox" /> <span>Hi</span>
            <input type="checkbox" /> <span>There</span>
            <input type="checkbox" /> <span>Friend</span>
        </div>
    );
}

export default App;
